import { Header, SubHeader, Background } from "./components";

const cards = [
  {
    name: "deadpool",
    img: "",
    price: "180$"
  },
  {
    name: "batman",
    img: "",
    price: "150$"
  },
  {
    name: "superman",
    img: "",
    price: "41$"
  }
]

function App() {
  return (
    <>
      <Header />
      <SubHeader />
      <Background src={"https://i.ytimg.com/vi/MJuFdpVCcsY/movieposter_en.jpg"} />
    </>
  );
}

export default App;
